  false,\n\t\"url\": null,\n\t\"notes\": \"These data are a collection of benthic
  habitat data from studies conducted in the coastal Long Island Sound, NY region
  in GIS shapefile (.shp, .dbf, .shx, and .prj files) with associated Federal Geographic
  Data Committee (FGDC) metadata. Generalized browse graphics were generated by the
  NODC and are included with the data.nIndividual subdirectories include data as follows
  - 2002 Long Island South Shore Estuary Benthic Habitat Polygon Data Set, 1995 benthic
  grab, sediment grab, and sediment profile image GIS point data files from inland
  harbor bays (Jamaica Bay), and 1994-1995 benthic grab, sediment grab, and sediment
  profile image GIS point data files from lower inland harbor bays.\",\n\t\"license_title\":
